navigator.geolocation.getCurrentPosition(function (pos) {
  console.log(pos);
  const latitude = pos.coords.latitude;
  const longitude = pos.coords.longitude;
  alert("현재 위치는 : " + latitude + ", " + longitude);
});

export default Weather;
